import React from "react";
import "./index.scss";
const LeadCards = props => {
  const { locations, workSpaceImg } = props;
  return (
    <div className="lead-card-container">
      <div className="locations-and-workspace-block"></div>
      <div className="lead-divider"></div>
      <div className="seats-and-lead-details"></div>
    </div>
  );
};

export default LeadCards;
